import React from "react";
import Icon from "../imgs/weather-icons/cloudy.png";

const MainBanner = (props) => {
    console.log(props);
    const {city,date,forcast}= props;
    return (
        <div className="mainBanner">
            <div className="mainBanner-cont--left">
                <h1>{city}</h1>
                <h5>{date}</h5>
                <div>
                    <img src={Icon} />
                </div>
                <h3>{forcast.currently.summary}</h3>
            </div>
            <div className="mainBanner-cont--right">
                <h2>{forcast.currently.temperature}</h2>
                <p>{forcast.daily[0].temperatureHigh} / {forcast.daily[0].temperatureLow}</p>
                <p>Cloudy throughout the day</p>
            </div>
        </div>
    );
};
export default MainBanner;
